import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import ReactHtmlParser, {processNodes, convertNodeToElement, htmlparser2} from 'react-html-parser'

export default function ICON() {
    const icons = {
        noIcon:
            `<svg viewBox="0 0 80 80" fill="none">
            <path d="M68 40C68 55.464 55.464 68 40 68C24.536 68 12 55.464 12 40C12 24.536 24.536 12 40 12C55.464 12 68 24.536 68 40Z" stroke="currentColor" stroke-linecap="round" stroke-linejoin="round" />
            <path d="M40 47.2V46.8197C40 43.9901 41.4911 41.3699 43.9237 39.9246L44.9751 39.3C47.4705 37.8175 49 35.1297 49 32.2271C49 27.6834 45.3166 24 40.7729 24H40C35.0294 24 31 28.0294 31 33V33.5082" stroke="currentColor" stroke-linecap="round" stroke-linejoin="round" />
            <path d="M40 53.6001V55.2001" stroke="currentColor" stroke-linecap="round" stroke-linejoin="round" />
          </svg>`,
        car:
            `<svg viewBox="0 0 80 80" fill="none"><path d="M14 43C14 38.5817 17.5817 35 22 35H58C62.4183 35 66 38.5817 66 43V49C66 51.2091 64.2091 53 62 53H18C15.7909 53 14 51.2091 14 49V43Z" stroke="currentColor" stroke-linecap="round" stroke-linejoin="round" /><path d="M17 52.874V58.3711C17 59.4757 17.8954 60.3711 19 60.3711H25C26.1046 60.3711 27 59.4757 27 58.3711V53" stroke="currentColor" stroke-linecap="round" stroke-linejoin="round" />
            <path d="M53 53V58.3711C53 59.4757 53.8954 60.3711 55 60.3711H61C62.1046 60.3711 63 59.4757 63 58.3711V52.874" stroke="currentColor" stroke-linecap="round" stroke-linejoin="round" />
            <path d="M59.8807 35L56.0929 25.2853C54.8953 22.2138 51.9361 20.1914 48.6394 20.1914H31.3604C28.0637 20.1914 25.1045 22.2137 23.9069 25.2853L20.1191 35" stroke="currentColor" stroke-linecap="round" stroke-linejoin="round" />
            <path d="M21 44.3711C21 42.7142 22.3431 41.3711 24 41.3711C25.6569 41.3711 27 42.7142 27 44.3711C27 46.0279 25.6569 47.3711 24 47.3711C22.3431 47.3711 21 46.0279 21 44.3711Z" stroke="currentColor" stroke-linecap="round" stroke-linejoin="round" />
            <path d="M59 44.3711C59 42.7142 57.6569 41.3711 56 41.3711C54.3431 41.3711 53 42.7142 53 44.3711C53 46.0279 54.3431 47.3711 56 47.3711C57.6569 47.3711 59 46.0279 59 44.3711Z" stroke="currentColor" stroke-linecap="round" stroke-linejoin="round" />
            </svg>`,

    }
    return (
        ReactHtmlParser(icons.carr || icons.noIcon)
    );
};
